import "./ProjectCardStyles.css"

import React from 'react'

const ProjectCard = () => {
  return (
    <div className="portfolio-container">
        <h1 className="project-heading">Projects</h1>
        <div className="project-container"></div>
    </div>
  )
}

export default ProjectCard
